import Layout from '../common/Layout';
import axios from 'axios';
import { useState, useEffect } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
	faChair,
	faBed,
	faDesktop,
	faWifi,
	faFan,
} from '@fortawesome/free-solid-svg-icons';

// key
// AIzaSyDv6JIUkmdFO-F6Ha1KriiO4uw0Iot8bb4

// palylist
// PLmAX7QJDEdu3phGnuvhY1SIPB47cipfvn

function Youtube() {
	const path = process.env.PUBLIC_URL;
	const desc =
		'Lorem ipsum dolor sit, amet consectetur adipisicing elit. Nulla iure nostrum quisquam minima dolores animi?';

	const [Vids, setVids] = useState([]);

	useEffect(() => {
		const key = 'AIzaSyDv6JIUkmdFO-F6Ha1KriiO4uw0Iot8bb4';
		const playlist = 'PLmAX7QJDEdu3phGnuvhY1SIPB47cipfvn';
		const num = 5;
		const url = `https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&key=${key}&playlistId=${playlist}&maxResults=${num}`;
		axios.get(url).then((json) => {
			setVids(json.data.items);
		});
	}, []);

	const vidList = [
		{
			name: 'CHAIR',
			icon: <FontAwesomeIcon icon={faChair}></FontAwesomeIcon>,
		},
		{
			name: 'BED',
			icon: <FontAwesomeIcon icon={faChair}></FontAwesomeIcon>,
		},
		{
			name: 'DESKTOP',
			icon: <FontAwesomeIcon icon={faChair}></FontAwesomeIcon>,
		},
		{
			name: 'WIFI',
			icon: <FontAwesomeIcon icon={faChair}></FontAwesomeIcon>,
		},
		{
			name: 'FAN',
			icon: <FontAwesomeIcon icon={faChair}></FontAwesomeIcon>,
		},
	];

	return (
		<>
			<Layout
				name='Youtube'
				desc={desc}
				visual={`${path}/img/sub/youtube/visual.jpg`}></Layout>
			<div id='youtube'>
				<ul className='list'>
					{vidList.map((list, idx) => {
						<li key={idx}>
							<h3>{list.name}</h3>
							<button>{list.icon}</button>
						</li>;
					})}
				</ul>
			</div>
		</>
	);
}

export default Youtube;
